import React from "react";
import { Link, NavLink } from "react-router-dom";
import Services from "./../Pages/Services";

function Header() {
  return (
    <div>
      <NavLink
        to="/home"
        style={(isActive) => ({
          color: isActive ? "green" : "blue",
        })}
      >
        Home
      </NavLink>
      <NavLink
        to="/about"
        style={(isActive) => ({
          color: isActive ? "green" : "blue",
        })}
      >
        About
      </NavLink>
      <NavLink
        to="/contuct"
        style={(isActive) => ({
          color: isActive ? "green" : "blue",
        })}
      >
        Contuct
      </NavLink>
      <NavLink
        to="/services"
        style={(isActive) => ({
          color: isActive ? "green" : "blue",
        })}
      >
        Services
      </NavLink>
    </div>
  );
}

export default Header;
